<h1 style="margin:10px 0;">Eagle Scouts of Troop 39</h1>

<!--####### The Eagle story and pin - first in code for right float  ###### -->
<div style="float:right; margin:0 30px; width:330px; font:14px Arial, Helvetica, sans-serif; line-height:125%;">
<img src="images/eaglePin.png" style="margin:-50px auto;">
<p style="margin-top:-20px;">The Eagle Scout Award. It's Scouting's highest rank and among its most familiar icons.
Men who have earned it count it among their most treasured possessions. Those who missed
it by a whisker remember exactly which requirement they didn't complete. Americans from
all walks of life know that being an Eagle Scout is a great honor, even if they don't know
just what the badge means.
<br><br>
The award is more than a badge. It's a state of being. You <em><strong>are</strong></em> an Eagle Scout - never
<strong><em>were</em></strong>. You may have received the badge as a boy, but you earn it every day as a man. In the
words of the Eagle Scout Promise, you do your best each day to make your training and
example, your rank and your influence count strongly for better Scouting and for better
citizenship in your troop, in your community, and in your contacts with other people. And
to this you pledge your sacred honor.</p>
</div>

